import './Register.css';
import axios from 'axios';
import { useState } from 'react';

function Register(){

    const [name , setName]=useState();

    const handleSubmit=()=>{
        axios.get("http://localhost:3001/user/test").then((res)=>{
                console.log(res.data);
        }).catch((err)=>{
                console.log(err);
        });

    }
    return(
        <>
         {/* About Start */}
    <div class="container py-5">
        <div class="row py-">
            <div class="col-lg-14 pb-5 pb-lg-0 px-3 px-lg-5">
                <h4 class="text-secondary mb-3">Register Here, </h4>
                <h1 class="display-4 mb-4"><span class="text-primary">Pawn</span> & <span class="text-secondary">Store</span></h1>
              <font color="orange"></font>
                <form>
                <div class="form-group">
    <label for="name">Name:</label>
    <input type="text" class="form-control" value={name} onChange={e=>setName(e.target.value)} />
  </div>
  <div class="form-group">
    <label for="email">Email address:</label>
    <input type="email" class="form-control" />
  </div>

  <div class="form-group">
    <label for="password">Password:</label>
    <input type="password" class="form-control" />
  </div>
  <br/>
  <div class="form-group">
    <label for="mobile">Mobile:</label>
    <input type="text" class="form-control" />
  </div>
  <br/>
  <div class="form-group">
    <label for="address">Address:</label>
    <textarea class="form-control" rows="5"></textarea>
  </div>
  <br/>
  <div class="form-group">
    <label for="city">City:</label>
    <select class="form-control" >
        <option >Select City</option>
        <option >Indore</option>
        <option >Bhopal</option>
        <option >Jabalpur</option>
    </select>
  </div>
  <div class="form-group">
    <label for="'gender'">Gender:</label>
    &nbsp;&nbsp;Male &nbsp;<input type="radio"  value="male" name="gender" />
    &nbsp;&nbsp;Female&nbsp;<input type="radio" value="female" name="gender"/>
  </div>
  <br/>
  <button type="button" class="btn btn-success">Submit</button>
</form>

            </div>

        </div>
    </div>
    {/* About End */}
        </>
    );
}
export default Register;
